Vox Futura&#xD;
Filosofia Tecnologica&#xD;
&#xD;
Es un placer anunciarte el nacimiento de un nuevo podcast de la produccion del iOski Podcast Group y ODC-Design para la Confederacion Internacional de Podcasters. Este podcast nace por intensos pedidos de nuestros oyentes y amigos, quienes viendo la tematica de nuestros podcasts, quieren mas y mejor material de analisis sobre el critico periodo sobre el cual se encuentra nuestra sociedad contemporanea. Siendo esta una sociedad moderna, lleva sus entrañas en la tecnologia y la presion que ella ejerce hoy en dia en nuestra cultura, politica y economica. Este podcast lleva por nombre VOX FUTURA (la voz que anuncia lo que viene llegando, o el futuro). Es un podcast serio, duro, muy directo, explicito al maximo, revolucionador, objetivo y tiene por objetivo despertar almas durmientes, desesperar mentes inquietas y renovar corazones cansados.&#xD;
Este es un podcast de analisis, critica y opinion, NO APTO PARA INMADUROS, donde mi voz no solo resonara en monologo sino tambien en fuertes debates con miembros de la Confederacion Internacional de Podcasters e invitados VIP.&#xD;
El contenido de los episodios de este podcast, han sido resultado de varios meses de preparacion por parte del iOski Podcast Group, especialmente en los foros de las secciones de FaceBook y Flickr.&#xD;
Espero que sea de tu agrado y, muy especialmente, que sea util...&#xD;
...y que tu vida nunca vuelva a ser la misma!&#xD;
-VOX FUTURA TEAM-
